style.css:
@-moz-document domain("roblox.com") {
body {
        background-image: url('https://media3.giphy.com/media/v1.Y2lkPTc5MGI3NjExMWZnMnNsOHdyYzgzMXRndzhmZzh5MjN2NHVpNnMzZG1weHBrYTFlZyZlcD12MV9pbnRlcm5hbF9naWZfYnlfaWQmY3Q9Zw/2rYrX9gXhqwccnz9B6/giphy.gif');
        background-size: contain; /* Adjust to maintain aspect ratio */
        background-repeat: no-repeat;
        background-position: center;
        position: relative;
        min-height: 100vh; /* Ensure the body takes the full height of the viewport */
        min-width: 100vw; /* Ensure the body takes the full width of the viewport */
    }

    /* Ensure the body fills the viewport */
    html, body {
        margin: 0;
        padding: 0;
        overflow: hidden; /* Prevent scrolling */
    }
}
